import React from "react";
import InputIcon from "@material-ui/icons/Input";

const DataPack = ({ name, description, value, onClick }) => {
  return (
    <div class="datapack">
      <h5>{name}</h5>
      <p>{description}</p>
      <button
        type="button"
        onClick={onClick}
        class="btn btn-primary rounded box-shadow"
        value={value}
        name={name}
      >
        ${value} <span />
        <InputIcon />
      </button>
    </div>
  );
};

export default DataPack;
